ster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* The sniper sound will now play when changing the option<br />* Fixed error when holding shift while removing items from a top-level group<br />* Optimized login and logout times<br />* [Retail] Removing invalid battlepets from groups to fix some errors<br />* [Retail] Added new bonusIds<br />* [Retail] Fixed some issues with Sniper<br />* [Retail] Optimized filter-based AH queries (including Sniper)<br />* [Retail] Fixed conflict with other addons which use the AH<br />* [Retail] Added chat message when other addons slow down TSM scans<br />* [Retail] Showing popup message if the WoW client is out of date<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1581295080,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-23-changelog/"}}}]]) --<APP_INFO,Global,1583777519>
